import { Grid } from '@mui/material'
import React from 'react'
import banner1 from '../assets/WhatsApp Image 2024-11-15 at 8.28.08 PM.jpeg'

const Banner = () => {
  return (
    <Grid container height={'60%'} sx={{mb:{md:-48, xs:0, sm:30}}}>
      <Grid   sx={{height:{md:'none', xs:'80%', sm:'50%'}}}>
      <img
                  src={banner1}
                  alt={banner1}
                  style={{ width: '100%',  height:{md:'60%', xs:'100%', sm:'50%'}  }} 
                />
      </Grid>
    </Grid>
  )
}

export default Banner
